// import Slider1 from "./pic/mainSlider/slider1.png";
// import Slider2 from "./pic/mainSlider/slider2.png";
// import Slider3 from "./pic/mainSlider/slider3.png";
// import Slider4 from "./pic/mainSlider/slider4.png";
function Home() {
    return (
        <>

            <div id="carouselExampleAutoplaying" className="carousel slide " data-bs-ride="carousel">
                <div className="carousel-inner">
                    <div className="carousel-item active">
                        <img src={slider1} className="w-100" />

                    </div>
                    <div className="carousel-item">
                        <img src={slider2} className="w-100" />
                    </div>
                    <div className="carousel-item">
                        <img src={slider3} className="w-100" />
                    </div>
                    <div className="carousel-item">
                        <img src={slider4} className="w-100" />
                    </div>
                </div>
                <button className="carousel-control-prev" type="button" data-bs-target="#carouselExampleAutoplaying"
                    data-bs-slide="prev">
                    <span className="carousel-control-prev-icon"></span>
                </button>
                <button className="carousel-control-next" type="button" data-bs-target="#carouselExampleAutoplaying"
                    data-bs-slide="next">
                    <span className="carousel-control-next-icon"></span>
                </button>
            </div>


        </>
    );
}
export default Home;
